import '../createTable.css';

type CellType = {
    id: number;
}
let mark: String = ''
function markCell() {
    mark = 'present'
}

export default function CreateCell(props: CellType) {

    return (
        <div className='cell' key={props.id} onClick={markCell}>{mark}</div>
    )
}
